import React from "react";

const About = () => {
  return (
    <div className="about">
      <div className="about_picture"></div>
      <div className="about_text">
        <h1 className="about_title"></h1>
        <h3 className="about_par"></h3>
      </div>
    </div>
  );
};

export default About;
